import React from "react"

const MenuItem = ({ title, subtitle, image }) => {
  return (
    <div className="menu-item">
      <div className="content">
        <h1 className="title">{title}</h1>
        <span className="subtitle">DETAILS</span>
      </div>
    </div>
  )
}

export default MenuItem
